import { z } from 'zod';

export const userSchema = z.object({
  name: z.string({ required_error: 'O campo Nome é obrigatório.' }),
  email: z
    .string({ required_error: 'O campo Email é obrigatório.' })
    .email('Email inválido'),
  username: z.string({ required_error: 'O campo Usuário é obrigatório.' }),
  password: z
    .string({ required_error: 'O campo Senha é obrigatório.' })
    .min(8, 'A senha deve ter pelo menos 8 caracteres'),
});
